Insert into SRD.RE_ETIQUETAS (ID,ID_SISTEMA,POSICION,DESCRIPCION,ESTATUS,USUARIO_I,FECHA_I,USUARIO_U,FECHA_U) values (232,7,'cuerpo','<p align="justify">"Al uso de la cuenta lcruzl, con la que podrá acceder a la LA PLATAFORMA DE TRÁMITES EN LÍNEA DEL ESTADO DE QUERÉTARO, el usuario se compromete, con fundamento en la Ley General de Responsabilidades Administrativas en su artículo 7, fracción VI y demás aplicables, así como en la normatividad o reglamentación que regule el caso concreto, a no divulgar su contraseña la cual es secreta y confidencial por lo que los movimientos registrados con dicha cuenta en los archivos históricos serán responsabilidad única y exclusiva del servidor público (a quien en lo sucesivo se le denominará el usuario). La información confidencial que por la naturaleza de su nombramiento, en este acto se le confía al usuario, así como los derechos otorgados a su cuenta para obtener, utilizar y/o alimentar los sistemas computacionales que son propiedad del Gobierno del Estado de Querétaro, por lo que se le prohíbe al usuario por sí o por interpósita persona, divulgar, sustraer, lucrar, destruir, ocultar o utilizar indebidamente la información que se encuentre bajo su custodia o a la cual tenga acceso o conocimiento. Si el usuario incurriera en actos que generen un daño a la plataforma, alterando o borrando los registros por una inadecuada utilización de la clave asignada, será sujeto de las sanciones que de conformidad con la Ley de Responsabilidad de los Servidores Públicos le pudieran corresponder, sin perjuicio de la responsabilidad civil o penal que con motivo de actos indebidos pudieran generarse. Las opciones a las que el usuario tiene acceso a la LA PLATAFORMA DE TRÁMITES EN LÍNEA DEL ESTADO DE QUERÉTARO, es a nivel [Dependencia] y será notificado de su contraseña inicial, la cual deberá modificarla una vez que la reciba. En caso de que el usuario olvide su contraseña, deberá notificarlo al Administrador correspondiente para que sea reestablecida. La Dirección se reserva el derecho de bloquear o cancelar esta cuenta sin previo aviso y hace constar que la contraseña tecleada por el usuario se encuentra codificada por medio de algoritmos ajenos a Gobierno del Estado de Querétaro, lo que la hace inaccesible a cualquier Administrador de los sistemas y/o equipos dentro de Gobierno. Asimismo, el usuario deberá cumplir los lineamientos establecidos por la Coordinación de Atención Ciudadana de la Secretaría Particular del C. Gobernador. Enterada la parte usuaria del contenido y alcance del presente resguardo, acepta las condiciones que para el acceso a la LA PLATAFORMA DE TRÁMITES EN LÍNEA DEL ESTADO DE QUERÉTARO, aquí se consignan, firmado de conformidad 31 de julio de 2019."<br></p>','AC','LCRUZL',to_date('02/12/19','DD/MM/RR'),null,null);
