Insert into SRD.RE_ETIQUETAS (ID,ID_SISTEMA,POSICION,DESCRIPCION,ESTATUS,USUARIO_I,FECHA_I,USUARIO_U,FECHA_U) values (363,21,'Apertura','La clave de acceso a (el) los servicio(s) que brinda el Poder Ejecutivo del Estado de Querétaro, siguiente(s):','AC','EHERMOSILLO',to_date('02/12/20','DD/MM/RR'),null,null);
Insert into SRD.RE_ETIQUETAS (ID,ID_SISTEMA,POSICION,DESCRIPCION,ESTATUS,USUARIO_I,FECHA_I,USUARIO_U,FECHA_U) values (364,21,'Apertura','El usuario, se compromete con fundamento en la Ley General de Responsabilidades Administrativas en su artículo 7, fraccion VI y demás aplicables, así como en la normatividad o reglamentación que regule el caso concreto, a darle solo el uso correspondiente a las labores propias del puesto desempeñado, con absoluto cuidado en la información consultada, enviada y procesada en cualquier horario a través de estos servicios; siempre en apoyo directo a las funciones relacionadas con su campo de responsabilidad laboral, sirviendo como herramienta para desempeñar dichas funciones, sin distraer sus labores cotidianas, y nunca divulgar información propiedad del Poder Ejecutivo del Estado de Querétaro. Esta(s) cuenta(s) y su(s) contraseña(s), son de tipo personal e intransferible, NO se deberá compartir ni divulgar con otras personas, ya que el único responsable es quien firma este resguardo. La información a la que se le da acceso mediante este documento, así como los derechos otorgados a su(s) cuenta(s) (Ver accesos y permisos incluidos en este resguardo), es propiedad de la Dependencia o Entidad que autoriza su acceso, por lo que se le prohíbe al usuario, por sí o por interpósita persona, divulgar, sustraer, lucrar, destruir, ocultar o utilizar indebidamente la información a la cual tenga acceso o conocimiento. Si el usuario incurriera en actos que generen un daño a la información y/o sistemas, altere o borre los registros sin causa fundada y motivada, registre información falsa o haga una inadecuada utilización de la cuenta y accesos a los sistemas o servicios asignados, responderá de manera personal por los mismos ante las autoridades competentes y en su caso será sujeto a las sanciones que de acuerdo a la Ley y a la norma le corresponden. En el caso de correo electrónico deberán evitarse él envío de correos tipo SPAM o tipo "cadena" de cualquier índole si no se tiene la autorización correspondiente. En el caso de Internet, la obtención de software por éste medio, debe cumplir con los estándares que establece la Normatividad Informática, en caso de obtener software sin licencia ni permiso por parte del fabricante, el Poder Ejecutivo no se hace responsable y el usuario podrá ser sujeto de las sanciones legales que establecen las leyes correspondientes. La Dirección se reserva el derecho de bloquear o cancelar esta cuenta sin previo aviso y hace constar que la contraseña tecleada por el usuario se encuentra codificada por medio de algoritmos ajenos al Poder Ejecutivo del Estado de Querétaro, lo que la hace inaccesible a cualquier administrador de los sistemas y equipos dentro del Poder Ejecutivo, en caso de que el usuario olvide su contraseña, deberá notificarlo al administrador correspondiente para que éste proceda a inicializar su contraseña. Cualquier movimiento laboral que tenga el resguardante, deberá ser notificado a "La Dirección" por su jefe inmediato o área administrativas correspondiente a fin de actualizar su información o bien para que la(s) cuenta(s) sea(n) dada(s) de baja, ya que cualquier movimiento que sea registrado y detectado con dicha cuenta aun después de terminada la relación laboral, podrá ser sujeto de las sanciones legales que establezca la Ley.','AC','EHERMOSILLO',to_date('02/12/20','DD/MM/RR'),null,null);
